import React from "react";
import "./About.css";
const About = () => {
  return (
    <div className="about">
      <div className="aboy title">
        <h1>Abot me</h1>
        <img src="" alt="" />
      </div>
      <div className="about-section">
        <div className="abot-left">
            <img src="" alt="" />
        </div>
        <div className="about-right">
           <p> </p>
           <p></p>
        </div>
      </div>
    </div>
  );
};

export default About;
